module.exports = {
  env: {
    browser: true,
    es2021: true,
    node: true,
  },
  extends: [
    "airbnb",
    "airbnb/hooks",
    "airbnb-typescript",
    "plugin:prettier/recommended",
    "plugin:tailwindcss/recommended",
  ],
  parser: "@typescript-eslint/parser",
  parserOptions: {
    ecmaVersion: "latest",
    sourceType: "module",
    project: "./tsconfig.json",
  },
  plugins: [
    "@typescript-eslint",
    "react",
    "import",
    "jsx-a11y",
    "unused-imports",
    "prettier",
    "tailwindcss",
  ],
  rules: {
    "unused-imports/no-unused-imports": "error",
    "prettier/prettier": "error",
    "react/function-component-definition": [
      "error",
      {
        namedComponents: "arrow-function",
        unnamedComponents: "arrow-function",
      },
    ],
    "import/extensions": ["off", "ignorePackages"],
    "jsx-a11y/no-static-element-interactions": "off",
    "jsx-a11y/click-events-have-key-events": "off",
    "react/require-default-props": "off",
    "import/no-extraneous-dependencies": ["error", { "devDependencies": ["**/electron/**", "**/preload/**"] }],
  },
  ignorePatterns: ["vite.config.ts", ".eslintrc.js"],
  settings: {
    "import/resolver": {
      node: {
        extensions: [".js", ".jsx", ".ts", ".tsx"],
      },
    },
  },
};

{
  "$schema": "https://ui.shadcn.com/schema.json",
  "style": "new-york",
  "rsc": false,
  "tsx": true,
  "tailwind": {
    "config": "tailwind.config.js",
    "css": "src/styles/global.css",
    "baseColor": "stone",
    "cssVariables": true,
    "prefix": ""
  },
  "aliases": {
    "components": "@/components",
    "utils": "@/lib/utils",
    "ui": "@/components/ui",
    "lib": "@/lib",
    "hooks": "@/hooks"
  }
}

{
  appId: "org.reorproject.reor",
  asar: true,
  directories: {
    output: "release/${version}",
  },
  files: ["dist-electron/**/*", "dist/**/*"],
  mac: {
    asarUnpack: ["**/*.{node,dll,metal,exp,lib}"],
    artifactName: "${productName}_${version}.${ext}",
    target: ["dmg", "zip"],
    extraResources: [
      {
        from: "./binaries/darwin/",
        to: "binaries",
        filter: ["**/*"],
      },
    ],
  },
  win: {
    artifactName: "${productName}_${version}.${ext}",
    asarUnpack: ["**/*.{node,dll,metal,exp,lib}"],
    target: [
      {
        target: "nsis",
        arch: ["x64"],
      },
    ],
    extraResources: [
      {
        from: "./binaries/win32/",
        to: "binaries",
        filter: ["**/*"],
      },
    ],
  },
  nsis: {
    oneClick: false,
    perMachine: false,
    allowToChangeInstallationDirectory: true,
    deleteAppDataOnUninstall: false,
  },
  linux: {
    artifactName: "${productName}_${version}.${ext}",
    asarUnpack: ["**/node_modules/sharp/**"],
    target: [
      {
        target: "AppImage",
      },
    ],
    category: "Utility",
    synopsis: "Short description of your app",
    description: "Full description of your app",
    extraResources: [
      {
        from: "./binaries/linux/",
        to: "binaries",
        filter: ["**/*"],
      },
    ],
  },
  publish: {
    provider: "generic",
    channel: "latest",
    url: "https://github.com/electron-vite/electron-vite-react/releases/download/v0.9.9/",
  },
}

